// src/components/Result.js

import React from 'react';

function Result({ patientData, uploadedImage, onSave }) {
    return (
        <div>
            <h2>Thông tin bệnh nhân</h2>
            <p>Tên: {patientData.name}</p>
            <p>Ngày sinh: {patientData.dob}</p>
            <p>Giới tính: {patientData.gender}</p>
            <p>Số điện thoại: {patientData.phone}</p>
            <p>Quê quán: {patientData.address}</p>

            <h2>Ảnh đã tải lên</h2>
            <img src={uploadedImage} alt="Uploaded" />

            <button onClick={onSave}>Lưu kết quả</button>
        </div>
    );
}

export default Result;
